            </div>

            <div className="col-4">
              <p className="india-text">{flagvalue.flag_title}</p>
            </div>

            <div className="col-4">
              <img src={flagvalue.flag_arrow_scr} alt="arrow_icons" className="arrow_icons" />
            </div>
          </div>

        </div>
    </div>

    )
  })
  return(
    <div>
      {flagdataItems}
    </div>
  )
}



// End----Flag home function 




// card carousel start
